import React from 'react';

import './App.css';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import image from "./image/collage6.jpg";
import Navbar from "./components/Navbar";
import Login from "./components/login.component";
import SignUp from "./components/signup.component";
import HomePage from "./components/HomePage";

function App() {
  return (
    <Router>
     <Navbar />

    <div className="App">
      /*<nav className="navbar navbar-expand-lg navbar-light fixed-top">


          <Link className="navbar-brand" to={"/sign-in"}></Link>
          <div className="collapse navbar-collapse" id="navbarTogglerDemo02">
            <ul className="navbar-nav ml-auto">
              <li className="nav-item">
                <Link className="nav-link" to={"/sign-in"}>Sign Up</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to={"/sign-up"}>Log In</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to={"/home-page"}>Home Page</Link>
              </li>
            </ul>
          </div>

      </nav>*/
      <div className="auth-wrapper" style={{ backgroundImage:"url("+ image +")"}}>
        <div className="auth-inner" >
          <Switch>
            <Route exact path='/' component={Login} />
            <Route path="/sign-in" component={Login} />
            <Route path="/sign-up" component={SignUp} />
            <Route path="/home-page" component={SignUp} />
          </Switch>
        </div>
    </div>
    </div>

     </Router>

  );
}

export default App;
